ieu: []
comment: |-
  SELECT DISTINCT T2.Name
  FROM country AS T1
  JOIN city AS T2 ON T2.CountryCode = T1.Code
  WHERE T1.Continent = 'Europe'
    AND T1.Name NOT IN
      (SELECT T3.Name
       FROM country AS T3
       JOIN countrylanguage AS T4 ON T3.Code = T4.CountryCode
       WHERE T4.IsOfficial = 'T'
         AND T4.Language = 'English')

sql: |-
  SELECT DISTINCT T2.Name
  FROM country AS T1
  JOIN city AS T2 ON T2.CountryCode = T1.Code
  WHERE T1.Continent = 'Europe'
    AND T1.Name NOT IN
      (SELECT T3.Name
       FROM country AS T3
       JOIN countrylanguage AS T4 ON T3.Code = T4.CountryCode
       WHERE T4.IsOfficial = 'T'
         AND T4.Language = 'English')
